  width: 100%;
  height: 100vh;
  background-image: linear-gradient(to bottom, #131424, #343b7c);
  display: flex;
`;
const Right = styled.div`
  flex: 1;
`;
const Left = styled.div`
  flex: 1;
  padding-left: 40px ;
`;
const Info = styled.div`
  margin-top: 30%;
`;
const Title = styled.h1`
  color: white;
  font-size: 76px;
  text-align: right;
  padding-right: 10% ;

`;
const Desc = styled.p`
  color: white;
  text-align: right;
  padding-right: 10% ;
`;
const OurMotive = () => {
  return (
    <>
      <Container>
        <Left>
          <Ladyillus />
        </Left>
        <Right>
          <Info>
              <Title>My Ambition</Title>
            <Desc>
              Lorem ipsum dolor sit amet, consectetur adipisicing elit. Rem quam
              earum eum beatae, officiis ad adipisci quos cumque quod quis
